import React from 'react';
import PropTypes from 'prop-types';

import { Col } from 'react-bootstrap';
import { FaBirthdayCake, FaRegClock } from 'react-icons/fa';

import './RecipeCard.css';

const RecipeCard = ({ recipe }) => {

  return (
    <Col xs="4" className="recipe-block-col">
      <article className="card shadow recipe-card">
        <a href="#a" className="card-link">
          <img src={recipe.image} className="card-img-top img-fluid h-100 w-100" alt={recipe.name} />
        </a>
        <div className="card-body">
          <h5 className="card-title"><a href="#e">{recipe.name}</a></h5>
          <div className="card-ratin-block">
            <span className="badge badge-success">5.0</span>
            <span className="border-right">4 отзыва</span>
            <span className="border-right"><FaBirthdayCake /> 8 Порции</span>
            <span><FaRegClock /> 1 час</span>
          </div>
          <footer className="categories">
            <a href="#a" className="category">Торты</a>
            <a href="#a" className="category">Вторые Блюда</a>
          </footer>
        </div>
      </article>
    </Col>
  );
};

RecipeCard.propTypes = {
  recipe: PropTypes.object
};

export default RecipeCard;
